import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import { Button } from "@mui/material"

const Typecard = (props) => {
    return (
        <Box sx={{mx:"30px", display:"flex", alignItems:"center", flexDirection:"column"}}>
            <Button sx={{width:"200px", height:"70px", backgroundColor:"#00FF00", color:"#FFFFFF"}}>{props.type}</Button>
            <Box sx={{width:"300px", height:"400px", mt:"20px", backgroundColor:"#F0F0F0"}}>
                <Typography component="h3" sx={{mb:"20px"}}>{props.title}</Typography>
                {props.content.map((item, index) => {
                    return <Typography component="h3">-{item}</Typography>
                })}
            </Box>
        </Box>
    )
}

export default Typecard;
